import Button from '../components/Button'

export default class Dashboard extends Component {
  render() {
    return (<div style = {{height:'50%', backgroundColor:'red'}}>
      <div>Dashboard</div>
      <Button text = "Subscriptions"/>
      </div>
    )
  }
}
